import sys
import os
from PySide2 import QtGui, QtCore, QtWidgets
from exifread import process_file

class Report(QtWidgets.QDialog):
    def __init__(self, num_completed, num_notcompleted, list_notcompleted):
        super(Report, self).__init__()
        self.setGeometry(350, 300, 400, 300)
        self.setWindowTitle('Renaming Report')

        list_stuff = QtWidgets.QListWidget()
        list_stuff.addItems(list_notcompleted)

        button_ok = QtWidgets.QPushButton('OK')
        button_ok.clicked.connect(self.ok)

        vbox_main = QtWidgets.QVBoxLayout()
        label1 = QtWidgets.QLabel('Successful images renamed: ' + str(num_completed))
        label2 = QtWidgets.QLabel('Images failed to be renamed: ' + str(num_notcompleted))

        vbox_main.addWidget(QtWidgets.QLabel('Operation Status Report:'))
        vbox_main.addSpacing(2)
        vbox_main.addWidget(label1)
        vbox_main.addWidget(label2)
        vbox_main.addSpacing(2)
        vbox_main.addWidget(list_stuff)
        vbox_main.addWidget(button_ok)

        self.setLayout(vbox_main)
        self.show()
        self.raise_()

    def ok(self):
        self.close()

class MainWindow(QtWidgets.QWidget):
    def __init__(self, parent=None):
        super(MainWindow, self).__init__(parent)
        self.setGeometry(300, 300, 100, 200)
        self.setWindowTitle('EXIF Renamer Utility')

        img_icon = QtGui.QImage()
        base64data = b''

        qlabel = QtWidgets.QLabel(alignment=QtCore.Qt.AlignCenter)
        ba = QtCore.QByteArray.fromBase64(base64data)
        pixmap = QtGui.QPixmap()
        pixmap.loadFromData(ba)
        qlabel.setPixmap(pixmap)
        qlabel.show()

        label_info = QtWidgets.QLabel(
            'Utility to quickly rename image files in a folder based on their EXIF embeded information. \nUses the DropBox based naming scheme.')

        self.checkbox_append = QtWidgets.QCheckBox('Append old name')
        self.checkbox_append.setChecked(True)
        self.checkbox_open = QtWidgets.QCheckBox('Open folder after')
        self.checkbox_open.setChecked(True)

        button_launch = QtWidgets.QPushButton('Load Folder')
        button_launch.clicked.connect(self.button_launched)

        vbox_main = QtWidgets.QVBoxLayout()

        vbox_main.addWidget(label_info)
        vbox_main.addWidget(qlabel)
        vbox_main.addWidget(self.checkbox_append)
        vbox_main.addWidget(self.checkbox_open)
        vbox_main.addWidget(button_launch)

        self.setLayout(vbox_main)
        self.show()
        self.raise_()

    def button_launched(self):
        folder = QtWidgets.QFileDialog.getExistingDirectory(caption="Please select a root Experiment directory:",
                                                options=QtWidgets.QFileDialog.ShowDirsOnly)

        num_completed = 0
        num_notcompleted = 0
        list_notcompleted = []

        #### EXIF READING AND RENAMING
        for file in os.listdir(folder):
            path = folder + os.sep + file
            if file.endswith(".jpg") or file.endswith('.jpeg') or file.endswith('.JPG'):
                with open(path, 'rb') as file_hande:
                    tags = process_file(file_hande, details=False)
                    file_hande.close()
                    if 'EXIF DateTimeOriginal' in tags:
                        data_tag = str(tags['EXIF DateTimeOriginal'])
                        self.rename_file(file, folder, data_tag)
                        num_completed += 1
                    elif 'EXIF DateTimeDigitized' in tags:
                        print(str(tags['EXIF DateTimeDigitized']))
                        self.rename_file(file, folder, data_tag)
                        num_completed += 1
                    else:
                        num_notcompleted += 1
                        list_notcompleted.append(file)
        #### Report
        report = Report(num_completed, num_notcompleted, list_notcompleted)
        if report.exec_():
            pass

        if self.checkbox_open.isChecked():
            #TODO: does not work on windows
            str_open = 'open ' + '"' + folder + '"'
            os.system(str_open)

    def rename_file(self, file, folder, data_tag):
        #2016-07-01 11.46.06.jpg
        #2016:06:03 16:51:57
        date, time = data_tag.split(' ')

        date = date.replace(':', '-')
        time = time.replace(':', '.')

        hours, minutes, seconds = time.split('.')

        #adjust hours
        hours = int(hours) - 0

        minutes = int(minutes) + 0

        seconds = int(seconds) + 0
        
        if minutes >= 60:
            minutes = minutes - 60
            hours = hours + 1

        if seconds >= 60:
            seconds = seconds - 60
            minutes = minutes + 1

        if minutes < 10:
            minutes = '0' + str(minutes)

        if seconds < 10:
            seconds = '0' + str(minutes)

        #rebuild time
        time = str(hours) + '.' + str(minutes) + '.' + str(seconds)

        os.chdir(folder)
        if self.checkbox_append.isChecked():
            os.rename(file, str(date) + ' ' + str(time) + ' -' + str(file.rsplit('.', 1)[0]) + '.jpg')
        else:
            os.rename(file, str(date) + ' ' + str(time) + '.jpg')

if __name__ == '__main__':
    app = QtWidgets.QApplication(sys.argv)
    mainwindow = MainWindow()
    mainwindow.show()
    app.exec_()
